import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './Auth/Login';
import Reset from './Auth/Reset';
import Header from './Builder/Header';
import Widgets from './widgets/Widgets';
import Dashboard from './Dashboard/Dashboard';
import NewLoan from './Pages/NewLoan';
import Loans from './Pages/Loans';
import Borrowers from './Pages/Borrowers';
import BorrowerDetails from './Pages/BorrowerDetails';
import AccountSummary from './Pages/NewLoan/AccountSummary';
import Sidebar from './Builder/Sidebar';

function Application() {
  return (
  <Router>
      <Route path="/" exact>
        <Login />
      </Route>
      <Route path="/password-reset" exact>
        <Reset />
      </Route>
      <Route path="/app/">
        

        <div className="container">
          <Header/>
            <Sidebar/>
          <Widgets/>
          
          <Switch>
            <Route path="/app/dashboard" exact>
              <Dashboard />
            </Route>
            <Route path="/app/new-loan" exact>
              <NewLoan />
            </Route>
            <Route path="/app/loans" exact>
              <Loans />
            </Route>
            <Route path="/app/borrowers" exact>
              <Borrowers />
            </Route>
            <Route path="/app/borrower-details" exact>
              <BorrowerDetails />
            </Route>
          </Switch>
        </div>
      </Route>
    </Router>
  );
}

export default Application;
